# 根据input，确认处理逻辑，返回值参与后续的case判定
def is_audio_file(input):
    import json
    input_new = input.strip("<lazyllm-query>")
    input_dict = json.loads(input_new)

    audio_extensions = {
        '.pdf', '.pptx', '.ppt'
    }
    image_extensions = {
        '.jpg', '.jpeg', '.png', '.gif', '.bmp', '.tiff', '.webp'
    }

    filepath = input_dict["files"][0]
    if '.' in filepath:
        extension = filepath.split('.')[-1].lower()
        ext_with_dot = '.' + extension

        if ext_with_dot in audio_extensions:
            return "reader"
        elif ext_with_dot in image_extensions:
            return "image"
        else: 
            return "error"

